import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function General(props) {
    let { location, current } = props;
    let {name} = location;
    let {temp_c, condition: {icon}} = current;

    return (    
        <Row>
            <Col>
                <span>{name}</span>
                <span>{temp_c}</span>
            </Col>

            <Col>
                <img src={`${icon}`} />
            </Col>
        </Row>
    )
}

export default General;
